# This Python code snippet can be used to count the frequency of words in a given text, which is useful for English language analysis.

def count_words(text):
    words = text.lower().split()
    word_count = {}
    for word in words:
        if word in word_count:
            word_count[word] += 1
        else:
            word_count[word] = 1
    return word_count

# Example usage:
text = "Python is fun. Fun is learning. Learning is important."
print(count_words(text))

# Python code snippet for History subject: Calculating the number of years between two historical events
def calculate_years_between_events(event1_year, event2_year):
    return abs(event1_year - event2_year)

# Example usage: Years between the fall of the Berlin Wall (1989) and the moon landing (1969)
years = calculate_years_between_events(1989, 1969)
print(f"The number of years between these events is: {years}")

# English subject code snippet: Word frequency counter in a text
def count_word_frequency(text):
    words = text.lower().split()
    frequency = {}
    for word in words:
        frequency[word] = frequency.get(word, 0) + 1
    return frequency

# Example usage
sample_text = "In English class we read books and write essays. Reading helps us understand the world."
print(count_word_frequency(sample_text))

